import { GET_LIST } from "./constants";

export const getData = () => {
    return (dispatch) => {
        fetch("https://api.coincap.io/v2/assets")
            .then(response => console.log(response.json()))
            .then(state => dispatch({
                type: GET_LIST,
                payload: state
            }));
    }
}
